import React from "react";

let mainHeading = { height: "89vh"};

const Firstpage = () => {
  return (
    <div>
      <div className="container">
        <div className="row w-auto d-flex align-items-center mx-3" style={mainHeading}>
          <div className="col-md-6 firstElem pb-lg-5">
            <h1>
              <span>Get Fit,</span> Strong & Motivated
            </h1>
            <button type="button" class="btn btn-outline-primary btn-lg">
              Register Now
            </button>
          </div>
          <div className="col-md-6" style={{ border: "2px solid" }}>
            <img src = {main} alt = "Main Page Icon"/>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Firstpage;
